	void XMLPrinter::PushComment(const char* comment)
	{
		SealElementIfJustOpened();
		if (_textDepth < 0 && !_firstElement && !_compactMode) {
			Print("\n");
			PrintSpace(_depth);
		}
		_firstElement = false;
		Print("<!--%s-->", comment);
	}


